export default (function(a,b,c,d,e){return {data:{k8GdWaROQx:{data:{id:1987,attributes:{imdbId:"tt0107756",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYmY1OTA3MjAtYjQxOC00OTlkLWExZWQtMjc3ZjExOWFhM2UwXkEyXkFqcGdeQXVyMTA0MjU0Ng@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.2\u002F10"},{Source:"Rotten Tomatoes",Value:"83%"},{Source:"Metacritic",Value:"74\u002F100"}],item_lang:{data:{id:2650,attributes:{title:a,plot:"Young nobleman Orlando is commanded by Queen Elizabeth I to stay forever young. Miraculously, he does just that. The film follows him as he moves through several centuries of British history, experiencing a variety of lives and relationships along the way, and even changing sex.",slug:"orlando"}}},books:{data:[{id:9959,attributes:{title:a,description:"One of BBC's 100 Novels That Shaped our World. Virginia Woolf’s wildly imaginative, comic novel was inspired by the life of her lover, Vita Sackville West. Part of the Macmillan Collector’s Library; a series of stunning, clothbound, pocket sized classics with gold foiled edges and ribbon markers. These beautiful books make perfect gifts or a treat for any book lover. This edition features original illustrations and with an introduction by the academic and novelist, Professor Susan Sellers. Orlando is a young Elizabethan nobleman whose wealth and status afford him an extravagant lifestyle. Appointed ambassador in Constantinople, he wakes one morning to find he is a woman. Unperturbed by such a dramatic transformation, and losing none of his flamboyance and ambition, the newly female Orlando charges through life and English history so that by the end of this extraordinary biography she is a modern, 1920s woman.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4ngQDgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2017-10-19",publisher:"Pan Macmillan",subtitle:c}},{id:9960,attributes:{title:a,description:"'I feel the need of an escapade after these serious poetic experimental books...I want to kick up my heels & be off.'Orlando tells the tale of an extraordinary individual who lives through centuries of English history, first as a man, then as a woman; of his\u002Fher encounters with queens, kings, novelists, playwrights, and poets, and of his\u002Fher struggle to find fame and immortality not through actions, butthrough the written word. At its heart are the life and works of Woolf's friend and lover, Vita Sackville-West, and Knole, the historic home of the Sackvilles. But as well as being a love letter to Vita, Orlando mocks the conventions ofbiography and history, teases the pretensions of contemporary men of letters, and wryly examines sexual double standards. This new edition discusses Woolf's stylistic aims, the biographical parallels, and the work's literary context, and includes the original illustrations.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=BYgbBQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2014-12-11",publisher:"Oxford University Press, USA",subtitle:e}},{id:9961,attributes:{title:a,description:"This title is also available as a filmle as a film___",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=2_ZhQgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1993-01-01",publisher:c,subtitle:e}},{id:9962,attributes:{title:"Orlando a Biography (Annotated)",description:"Orlando: A Biography is an influential novel Virginia Woolf, first published on 11 October 1928. A semi-biographical novel based in part on the life of Woolf's lover Vita Sackville-West, it is generally considered...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=i0jdwQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2019-01-27",publisher:"Independently Published",subtitle:c}},{id:9963,attributes:{title:a,description:c,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=RX1mSAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"Brigitte Walitzek"],firstBook:d,published:"1992-01-01",publisher:c,subtitle:"eine Biographie"}}]}}},meta:{}}},prerenderedAt:1680940949177}}("Orlando","Virginia Woolf","",null,"A Biography"))